    <MenuItem>
      <Button> Sign-Up </Button>
    </MenuItem>
    <MenuItem>
      <Button> Sign In </Button>
    </MenuItem>
      </Menu>
      <header className="App-header">
        <h1>Peer Evaluation Signup</h1>
      </header>

      {/* Render the Signup component */}

    </div>
  );
}

export default App;
